// SPDX-License-Identifier: MIT 
pragma solidity >=0.5.0;
import "./zombieWeapons.sol";

contract ZombieSurvive is ZombieWeapons {
    struct Class {
        uint32 energy;
        uint32 weight;
        uint32 damage;
        uint8 health;
    }

    
    
    struct Player {
        string name;
        uint8 hunger;
        uint8 water;
        uint32 level;
        bool alive;
        bool busy;
        Class class;
        Weapon weapon;
    }

    mapping (uint => address) IdToUser;
    mapping (address => uint) OwnerToId;
    mapping (address => uint) OwnerIdCount;

    event PlayerCreated(uint id, string name, string classType);
    event Victory(string result, uint enemy, uint player);
    event Players(Player[] players);

    Player[] public players;
    function createPlayer(string memory _name, string memory _class) external {

        if (keccak256(abi.encodePacked(_class)) == keccak256(abi.encodePacked("melee"))) {
            players.push(Player(_name,100,100,1,true,false,Class(100,100,100,100), Weapon('fist',10,10,10)));
            uint id = uint(players.length) - 1;
            IdToUser[id] = msg.sender;
            OwnerToId[msg.sender] = id; 
            OwnerIdCount[msg.sender] ++;
            emit PlayerCreated(id, _name, _class);

        } else {
            players.push(Player(_name,100,100,1,true,false,Class(80,80,80,80), Weapon('fist',5,5,5)));
            uint id = uint(players.length - 1);
            IdToUser[id] = msg.sender;
            OwnerToId[msg.sender] = id;
            OwnerIdCount[msg.sender] ++;
            emit PlayerCreated(id, _name, _class);
        }
        emit Players(players);
    }

    function findWeapon(string memory _name) external{
        uint modulus = 100;
        uint success = 99;
        uint result = _rolldice(modulus, OwnerToId[msg.sender]);

        address player = msg.sender;
        if(result <= success) {
            _obtainWeapon(player, _name);
        }
    }

    function getWeaponsByOwner(address _owner) external view returns(uint[] memory) {
    uint[] memory result = new uint[](OwnerWeaponCount[_owner]);
    uint counter = 0;
    for (uint i = 0; i < weapons.length; i++) {
      if (WeaponToOwner[i] == _owner) {
        result[counter] = i;
        counter++;
      }
    }
    return result;
    }

    function changeWeapon(uint id) external {
        require(msg.sender == WeaponToOwner[id]);

        players[OwnerToId[msg.sender]].weapon = weapons[id];
    }
    
    function TakeALook() external{
        
        uint playerId = OwnerToId[msg.sender];
        uint result = _getRoll(playerId);
        if(result == 1) {
            players[playerId].busy = true;
            Player memory player = players[playerId];
            Zombie memory enemy = _zombieGen(playerId);
            if (enemy.health <= (player.class.damage + player.weapon.damage)) {
                emit Victory("Victory!!!", (player.class.damage + player.weapon.damage),enemy.health);
                players[playerId].level++;
        }

            else{
                emit Victory("Lose!", (player.class.damage + player.weapon.damage),enemy.health);
                players[playerId].alive = false;
                uint timestap = block.timestamp;
            }


            
            

        }   else {
            emit Victory("Nothing was found", 0, players[playerId].class.damage);
        }
    }


}

contracts/zombieWeapons.sol.content:
// SPDX-License-Identifier: MIT 
pragma solidity >=0.5.0;
import "./lookAround.sol";


contract ZombieWeapons is LookAround{
    struct Weapon {
        string name;
        uint8 range;
        uint8 damage;
        uint8 durability;

    }
    mapping (uint => address) WeaponToOwner;
    mapping (address => uint) OwnerWeaponCount;
    

    Weapon[] public weapons;
    mapping (uint => Weapon) WeaponId;

    event WeaponFound(address playerId, string name, uint weaponProperties);

    uint RandNonce = 0;
    function _weapongenerator(string memory _name) internal returns(uint) {
        uint weaponProperties = uint(keccak256(abi.encodePacked(block.timestamp, RandNonce, _name))) % (10**9);
        
        RandNonce++;
        
        return(weaponProperties);
    }

    function _obtainWeapon(address _playerId,string memory _name) internal{
        
        uint weaponProperties = _weapongenerator(_name);
        uint range = weaponProperties/1000000;
        uint damage = weaponProperties / 1000 % 1000;
        uint durability = weaponProperties % 1000;
        weapons.push(Weapon(_name,uint8(range), uint8(damage), uint8(durability)));
        uint id = weapons.length - 1;
        WeaponToOwner[id] = _playerId;
        OwnerWeaponCount[_playerId] ++;
        emit WeaponFound(_playerId, _name, weaponProperties);

    }


}

